import React from 'react'
import HomeIcon from '@material-ui/icons/Home';
import DevicesIcon from '@material-ui/icons/Devices';
export const SidebarData = [
    {
        title: "Dashboard", 
        icon: <HomeIcon />,
        link: "/dashboard"
    },
    {
        title: "Thông tin thiết bị", 
        icon: <DevicesIcon />,
        link: "/device"
    },
    {
        title: "Home", 
        icon: <HomeIcon />,
        link: "/home"
    },
]
